INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 10.85, 100, 7, 24, 100, "エリコ", 10142, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", "2030/12/17 14:59:59", 1, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 11.15, 101, 2, 24, 101, "エリコ", 10142, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", "2030/12/17 14:59:59", 1, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 6.4, 102, 5, 24, 102, "エリコ", 10142, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", "2030/12/17 14:59:59", 7, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 0.0, 103, 3, 24, 103, "エリコ", 10142, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", "2030/12/17 14:59:59", 3, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 2.43, 104, 8, 24, 104, "エリコ", 10142, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", "2030/12/17 14:59:59", 2, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 9.08, 105, 3, 24, 105, "エリコ", 10142, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", "2030/12/17 14:59:59", 4, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 0.0, 106, 6, 24, 106, "エリコ", 10142, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", "2030/12/17 14:59:59", 6, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 10.6, 107, 8, 24, 107, "エリコ", 10142, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", "2030/12/17 14:59:59", 3, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 7.54, 108, 4, 24, 108, "エリコ", 10142, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", "2030/12/17 14:59:59", 6, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 11.5, 109, 7, 24, 109, "エリコ", 10142, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", "2030/12/17 14:59:59", 2, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 8.83, 110, 1, 24, 110, "エリコ", 10142, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", "2030/12/17 14:59:59", 2, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 6.68, 111, 2, 24, 111, "エリコ", 10142, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", "2030/12/17 14:59:59", 1, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 8.8, 112, 2, 24, 112, "エリコ", 10142, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", "2030/12/17 14:59:59", 6, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 8.9, 113, 1, 24, 113, "エリコ", 10142, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", "2030/12/17 14:59:59", 2, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 3.7, 114, 5, 24, 114, "エリコ", 10142, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", "2030/12/17 14:59:59", 2, 129901, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 7.6, 200, 2, 24, 200, "マコト", 10142, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", "2030/12/17 14:59:59", 1, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 2.25, 201, 1, 24, 201, "マコト", 10142, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", "2030/12/17 14:59:59", 2, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 3.28, 202, 1, 24, 202, "マコト", 10142, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", "2030/12/17 14:59:59", 2, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 2.98, 203, 1, 24, 203, "マコト", 10142, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", "2030/12/17 14:59:59", 4, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 3.0, 204, 1, 24, 204, "マコト", 10142, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", "2030/12/17 14:59:59", 4, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 10.3, 205, 2, 24, 205, "マコト", 10142, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", "2030/12/17 14:59:59", 1, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 2.93, 206, 1, 24, 206, "マコト", 10142, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", "2030/12/17 14:59:59", 6, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 9.3, 207, 1, 24, 207, "マコト", 10142, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", "2030/12/17 14:59:59", 3, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 6.9, 208, 1, 24, 208, "マコト", 10142, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", "2030/12/17 14:59:59", 4, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 0.0, 209, 2, 24, 209, "マコト", 10142, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", "2030/12/17 14:59:59", 2, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 5.95, 210, 2, 24, 210, "マコト", 10142, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", "2030/12/17 14:59:59", 1, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 6.73, 211, 1, 24, 211, "マコト", 10142, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", "2030/12/17 14:59:59", 2, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 0.0, 212, 2, 24, 212, "マコト", 10142, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", "2030/12/17 14:59:59", 2, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 6.65, 213, 2, 24, 213, "マコト", 10142, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", "2030/12/17 14:59:59", 1, 129801, 0.0);
INSERT INTO `v1_d75214c0ec7e8e8d7314493ee45a28518d2ec427e1c98bc3788e2c0830eb1dda` VALUES (0.0, "2024/03/31 12:00:00", 3.05, 214, 1, 24, 214, "マコト", 10142, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", "2030/12/17 14:59:59", 6, 129801, 0.0);
